import style from '../mystyle.module.css';
import Header from './Header';
import Footer from './Footer';

function About(){
    return(
        <div>
            <Header />
            <div>
                <h1 className={style.about}>ABOUT</h1>
                <ROW>
                    <Col xs='3' md='3' lg='12'></Col>
                </ROW>
            </div>
            <Footer />
        </div>
    );
}

export default About;
